def save_user_to_db(user_id, username, first_name, last_name):
    connection = sqlite3.connect('users.db')
    cursor = connection.cursor()
    cursor.execute('''
    INSERT OR IGNORE INTO users (user_id, username, first_name, last_name) 
    VALUES (?, ?, ?, ?)
    ''', (user_id, username, first_name, last_name))
    connection.commit()
    connection.close()

def get_all_users():
    connection = sqlite3.connect('users.db')
    cursor = connection.cursor()
    cursor.execute('SELECT user_id FROM users')
    users = cursor.fetchall()
    connection.close()
    return [user[0] for user in users]

import datetime


def get_users_last_24_hours():
    now = datetime.datetime.now()
    past_24_hours = now - datetime.timedelta(hours=24)
    past_24_hours_str = past_24_hours.isoformat()
    
    connection = sqlite3.connect('users.db')
    cursor = connection.cursor()
    cursor.execute('SELECT COUNT(*) FROM users WHERE added_at > ?', (past_24_hours_str,))
    count = cursor.fetchone()[0]
    connection.close()
    return count


